val sqlContext = new org.apache.spark.sql.hive.HiveContext(sc)
//1. Create a u_data table in Hive using Spark SQL.
sqlContext.sql("create TABLE u_data ( userId INT, movieId INT, rating INT, time STRING ) ROW FORMAT DELIMITED FIELDS TERMINATED BY '\t' STORED AS TEXTFILE") 
//2. See the field descriptions of the u_data table.
sqlContext.sql("describe u_data")
//3. Load data into the u_data table from a HDFS text file.
sqlContext.sql("LOAD DATA INPATH '/Users/mmena/Desktop/ApacheCourse/zeppelin-0.6.2-bin-all/files/u.data' OVERWRITE INTO table u_data") 
//4. Show all the data in the newly-created u_data table.
sqlContext.sql("select * from u_data").show

